import React from "react";
import '../style.css';

export const Nav = () => {
    return (
        <div>
            <div className="Navigation">
                <ul>
                    <li>ABOUT</li>
                    <li>CONTACT</li>
                    <li>PROJECTS</li>
                </ul>
            </div>
        </div>
    )
};

export const Content = () => {
    return (
        <div>
            <div>
                <h1>WELCOME TO MY PORTFOLIO</h1>
                <p>Welcome to my portfolio have a look at my projects, videos,
                    art and biography to learn more about me and what I do for a living.
                </p>
                <button>Learn More</button>
            </div>
        </div>
    )
}

const Home = () => {
    return (
        <div className="Home">
            <div className="leftPanel">
                <div className="Logo">RAFEEQ WEIDEMAN</div>
                <div className="pages">
                    <ul>
                        <li>Welcome</li>
                        <li>About Me</li>
                        <li>What I Do</li>
                        <li>Get In Touch</li>
                    </ul>
                </div>
            </div>

            <div className="rightPanel">
                <Nav />
                <div className="content">
                    <Content />

                </div>

            </div>
        </div>
    )
}

export default Home;
